styles:
.som {
    width: 100%;
    position: relative;
}

.ngxcarousel {
    width: 100%;
    position: relative;
}

.ngxcarousel-inner {
    position: relative;
    overflow: hidden;
}

.ngxcarousel-items {
    white-space: nowrap;
    position: relative;
}

.item {
    display: inline-block;
    white-space: initial;
}

.tile {
    box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.16), 0 2px 10px 0 rgba(0, 0, 0, 0.12);
    margin: 5px;
}

.leftRs {
    position: absolute;
    margin: auto;
    top: 0;
    bottom: 0;
    left: 0;
    width: 50px;
    height: 50px;
    box-shadow: 1px 2px 10px -1px rgba(0, 0, 0, .3);
    border-radius: 999px;
}

.rightRs {
    position: absolute;
    margin: auto;
    top: 0;
    right: 0;
    bottom: 0;
    width: 50px;
    height: 50px;
    box-shadow: 1px 2px 10px -1px rgba(0, 0, 0, .3);
    border-radius: 999px;
}

.banner .ngxcarouselPoint {
    position: absolute;
    width: 100%;
    bottom: 20px;
}

.banner .ngxcarouselPoint li {
    background: rgba(255, 255, 255, 0.55);
}

.banner .ngxcarouselPoint li.active {
    background: white;
}

.ngxcarouselPoint ul {
    list-style-type: none;
    text-align: center;
    padding: 12px;
    margin: 0;
    white-space: nowrap;
    overflow: auto;
}

.ngxcarouselPoint ul li {
    display: inline-block;
    border-radius: 50%;
    background: rgba(0, 0, 0, 0.55);
    padding: 4px;
    margin: 0 4px;
    transition-timing-function: cubic-bezier(.17, .67, .83, .67);
    transition: .4s;
}

.ngxcarouselPoint ul li.active {
    background: #6b6b6b;
    transform: scale(1.8);
}

